  "fixed_xml": "<ITEM>4. Bey Herrn Hans Jacob Bischoff, Buchh\u000cndlern allhier werden Subscriptionen angenommen, auf folgende 3. sch\u0002ne Wercker, welche zu Pari\u000cs ne\u000ba im Druck beraus kommen, als nehmlich: <BIBL><TITLE>Pour le Dictionaire Universel de Medecine, de Physique, de Chymie, de Botanique, de Chirurgie, d'Anatomie, de Phermacie &c.</TITLE>, en <VOLUME>six Volumes</VOLUME> in <FORMAT>Folio</FORMAT>, avec Figures, traduit de l'Anglois de <AUTHOR>Mr. James, Docteur en Medecine</AUTHOR>; Davon der Praenumerations-Prei\u000cs <PRIZE>100. Pfund Frantz\u0002s. Valuta</PRIZE>, und stehet die Subscriptions-Zeit nur noch bi\u000cs Ende Februarii offen.</BIBL> <BIBL><TITLE>PHistoire generale des Vovages, 0u Nouvelle Collection de toutes les Relations de Voyages par Mer & par Terre, qusont Ete publiee jusqua present dans les differentes Lanques de toutes les Nations connues, &c.</TITLE>, en <VOLUME>din Vol.</VOLUME> <FORMAT>4to.</FORMAT> ave Fig.: Quvrage publie enAngleterre avec un Privilege special duRoy & duParlement, & traduit en Francois par POrdre de <AUTHOR>Monsgr. le Chancelier de France</AUTHOR>. Jeder Theil auf ord. Papier wird denen Herren Praenumeranten vor <PRIZE>12 Pfund</PRIZE> erlassen, und zahlen dieselben gleich dato zum voraus <PRICE>18. Pfund</PRICE>. Die Subscriptionen werden bi\u000cs Primo Martii angenommen und wird der erste Tomus mediosprilis ausgeltefert.</BIBL> <BIBL><TITLE>l'AnneeChretienne, contenant les Messes des Dimanches & des Fetes de toute l Anne, en Latin & en Frangois, avec lExplication des Epitres & des Evangiles, & les Mes. ses votires de toute lAnnee</TITLE>; par <AUTHOR>Mons. Le Tourneun</AUTHOR>, in <VOLUME>12. XIII. Vol.</VOLUME> Das Werck omplet kostet <PRICE>30. Pfund</PRICE> davon gleich dato <PRICE>15. Pfund</PRICE> und die restirende <PRICE>15. Pfund</PRICE> im Monath Junio bezahlt werden. Die Subscriptionen stehen bi\u000cs primo Aprilis offen, und zu nahmlicher Zeit k\u0002nnen auch die 4. ersten Theile enthoben werden.</BIBL> Die Projecte sind in obigem Buchladen zu sehen, allwo auch der n\u000bahere Bericht zu vernehmen ist.</ITEM>",  
